  `reg_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否激活  0未激活  1激活',
  `today_reward` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '日分红奖励累计',
  `team_reward` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '团队奖励累计',
  `day_award` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '当日奖励，每天清零',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '用户账户余额',
  `head_img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '头像图片',
  `tj_1` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上1级推荐人',
  `tj_2` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上2级推荐人',
  `tj_3` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上3级推荐人',
  `tj_4` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上4级推荐人',
  `tj_5` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上5级推荐人',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=1059 DEFAULT CHARSET=utf8 COMMENT='用户表';

