-- ----------------------------
-- Table structure for tf_pay
-- ----------------------------
DROP TABLE IF EXISTS `tf_pay`;
CREATE TABLE `tf_pay` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `myself_trade_no` varchar(255) NOT NULL COMMENT '我们平台的交易单号',
  `pay_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付人uid  0代表系统',
  `receive_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '收钱uid 0代表系统',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '交易类型 1注册 2下级支付上级费用(升级费用)',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '交易金额',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '交易说明',
  `time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '交易时间',
  `other_trade_no` varchar(255) NOT NULL DEFAULT '' COMMENT '第三方交易平台的交易号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '交易状态 0 未支付 1已支付',
  `dakuan_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '打款id',
  `space` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '盘子',
  `is_compare` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否比较过',
  PRIMARY KEY (`id`),
  UNIQUE KEY `myself_trade_no` (`myself_trade_no`)
) ENGINE=InnoDB AUTO_INCREMENT=1043 DEFAULT CHARSET=utf8 COMMENT='交易明细表';

