-- ----------------------------
-- Table structure for tf_user
-- ----------------------------
DROP TABLE IF EXISTS `tf_user`;
CREATE TABLE `tf_user` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'uid自动递增',
  `uname` varchar(255) NOT NULL COMMENT '用户名',
  `phone` varchar(32) NOT NULL COMMENT '电话号码',
  `weixin_name` varchar(255) NOT NULL COMMENT '微信号',
  `id_card` varchar(32) NOT NULL COMMENT '身份证',
  `bank_num` varchar(32) NOT NULL COMMENT '银行卡号',
  `bank` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '所属银行编码',
  `salt` char(4) NOT NULL COMMENT '加密字符串',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `tj_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '推荐人uid',
  `reg_time` int(10) unsigned NOT NULL COMMENT '注册时间',
  `qr_code_url` varchar(255) NOT NULL COMMENT '二维码图片地址',
  `level` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '等级',
  `space` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '空间（每个空间金额基数不一样）',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否激活  0未激活  1激活 2还要邀请两个人才能激活 3还要邀请一个人才能激活 ',
  `money` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '用户账户金额',
  `frozen_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '冻结时间(收到最后一个红包后不升级则冻结)',
  `is_company` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否是公司账号',
  `company_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '0为个人账号自动生成的账号(会再程序自增)',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=1054 DEFAULT CHARSET=utf8 COMMENT='用户表';

